import React from 'react';
import './about.css';
import {Container, Row, Col, Image} from 'react-bootstrap';
import Header from '../../common/sectionHeader/sectionHeader.js';
import VR from '../../../media/vr-img.jpg';

function about() {
    return (
        <section className = "about" id = "about">
            <Container>
                <Header effectType = "fade-up" headerText = "about" contentText = "Learn about the about we used in our solution"></Header>
                <Row>
                    <Col data-aos = "fade-left" xs={{ span: 12, order: 1 }} lg = {{ span: 7, order: 2}} className = "my-5 d-flex align-items-center justify-content-center text-right">
                    <h1>A title card thing<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p></h1>
                    </Col>
                    <Col lg = {5} className = "my-5 d-flex justify-content-end">
                        <div className = "phone-container-right">
                            <Image data-aos = "fade-left" src = {VR} fluid></Image>
                        </div>
                    </Col>
                </Row>

            </Container>
        </section>
    )
}

export default about
